import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import GreetForm from "./GreetForm";
// Import OtherComponent here

function Header() {
  return (
    <header className="PageHeader">
        di
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link> {/* Adjust this Link as needed */}
          </li>
          <li>
            <Link to="/other">Other Subpage</Link> {/* Adjust this Link as needed */}
          </li>
        </ul>
      </nav>
    </header>
  );
}

function Footer() {
  return <footer className="PageFooter">Footer content here</footer>;
}

function OtherComponent() {
  return <div>This is another subpage content.</div>;
}

function Page() {
  return (
    <Router>
      <div className="Page">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<GreetForm />} />
            <Route path="/other" element={<OtherComponent />} />
            {/* Add more routes as needed */}
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default Page;
